import { Component } from "react";

export default class Org extends Component {
    constructor(props) {
        super(props)
    }

    async componentDidMount() {
        this.setState({
            name: "org name"
        });
    }

    imgSrc() {
        return `/api/orgs/${this.props.orgID}/logo`
    }

    render() {
        if (!this.state) {
            return <div/>;
        }


        return (
            <div>
                <img src={this.imgSrc()} className="org-logo" />
                <h1>{this.state.name}</h1>
            </div>
        );
    }
}
